import React, { useEffect, useState } from "react";
import axios from "axios";

function Fetch(url) {
  const [maa, setMaa] = useState([]);

  useEffect(() => {
    axios.get(url).then((res) => {
      setMaa(res.data);
    });
  }, []);

  return maa
}

export default Fetch;
